import React from "react";

import SiteButton from "../UI/SiteButton";
import Header from "../Components/Header";
import SubPortfolioInfo from "../UI/SubPortfolioInfo";
import CategoriBox from "../UI/CategoriBox";
import Footer from "../Components/Footer";

import classes from "./Compose.module.css";
import classes2 from "./Nespresso.module.css";

const Dyson = () => {
  return (
    <div
      style={{
        width: "100%",
        maxWidth: "1920px",
        margin: "0 auto",
        position: "relative",
      }}
    >
      <Header bgColor=" " titleColor="#ffffff" />

      <div
        style={{
          background: "url(images/sub_dyson_banner.png)",
          width: "100%",
          height: "980px",
          margin: "0 auto",
        }}
      >
        <SubPortfolioInfo />

        <SiteButton
          className={classes.composeBtn}
          btnColor="#71ab4d"
          textColor="#ffffff"
          width="150px"
          top="760px"
          left="370px"
          link="dyson/index.html"
        />
      </div>

      <section className={classes2.subInfo}>
        <div className={classes2.subInfoContent}>
          <div
            className={classes2.infoTitle}
            style={{ margin: "0 auto", paddingTop: "180px" }}
          >
            <div
              className={classes2.infoLogo}
              style={{
                width: "218px",
                height: "45px",
                margin: "0 auto",
                background: "url(images/logo_nespresso.png) no-repeat",
              }}
            >
              <p style={{ textAlign: "center", marginTop: "38px" }}>
                네스프레소는 1980년대 유럽시장에서 처음 소개된 '네슬레'의
                캡슐커피 브랜드입니다.
                <br />
                현재 캡슐의 특허가 만료되어 다양한 브랜드에서 호환캡슐이
                출시되고 있습니다.
              </p>
            </div>
          </div>
        </div>
      </section>

      <SiteButton
        className={classes.composeBtn}
        btnColor="#71ab4d"
        textColor="#ffffff"
        width="452px"
        top="6390px"
        link="dyson/index.html"
        left="50%"
        transX="-50%"
      />

      <Footer footerTop="6500px" />
      {/* <img src="images/dyson.png" alt="다이슨" /> */}
    </div>
  );
};

export default Dyson;
